import { NavLink, useParams } from "react-router-dom";

let subCategoriesBack = []

const removeAccents = (str) => {
    return str.normalize("NFD").replace(/[\u0300-\u036f]/g, "");
  }

function SubCategories () {
    const { category } = useParams()
    if (category === 'altavoces' || 'mp3' || 'radios' || 'tocadiscos' || 'walkman') subCategoriesBack = ['altavoces', 'mp3', 'radios', 'tocadiscos', 'walkman']
    if (category === 'cables' || 'despertadores' || 'gps' || 'librosElectronicos' || 'maquinasEscribir' || 'tdt') subCategoriesBack = ['cables', 'despertadores', 'gps', 'librosElectronicos', 'maquinasEscribir', 'tdt']
    if (category === 'cartuchos' || 'consolas') subCategoriesBack = ['cartuchos', 'consolas']
    if (category === 'accesorios' || 'monitores' || 'ordenadores' || 'teclados') subCategoriesBack = ['accesorios', 'monitores', 'ordenadores', 'teclados']
    if (category === 'cintas' || 'vinilos') subCategoriesBack = ['cintas', 'vinilos']
    if (category === 'fijos' || 'moviles') subCategoriesBack = ['fijos', 'moviles']
    // if (category === 'camaraFotos' || 'camaraVideo' || 'televisores') subCategoriesBack = ['camaraFotos', 'camaraVideo', 'televisores']

    return (
        <ul>
            {subCategoriesBack.map(subCategory =>
                <li key={subCategory}><NavLink to={`/article/bySubCategory/${removeAccents(subCategory.toLocaleLowerCase())}`}>{subCategory}</NavLink></li>
                )}
        </ul>
    )
}

export default SubCategories
